export const Default_value = {
    product: "",
    categories: ""
  };
  
  


export const product_reducer =(state,action)=>{
    switch (action.type) {
        case "PRODUCT_CHANGE":
          return { ...state, product: action.payload.collection };
        case "CATEGORIES_CHANGE":
          return { ...state, categories : action.payload.hascategories };
       
        default:
          return state;
      }
}
